import styled from "styled-components";
import Button from "./Button";

const Item = styled.div`
    margin-top: 1%;
    border: 1px solid;
    border-radius: 10px;
    padding: 1%;
    width: 55%;
`
const TextDiv = styled.div`
    font-size: 2em;
    text-align: left;
    float: left;
`

const ButtonDiv = styled.div`
    float: right;
`

function TodoItem(props) {
    return (
        <Item>
            <TextDiv>
                {props.text}
            </TextDiv>
            <Button
                text="Edit"
                color="#00b8a9"
            />
        </Item>
    );
}

export default TodoItem;
